				"vec3 dirHalfVector = normalize( dirVector + viewDirection );",
				"float dirDotNormalHalf = max( dot( normal, dirHalfVector ), 0.0 );",
				"float dirSpecularWeight = specularStrength * pow( max( dirDotNormalHalf, 0.0 ), shininess );",

